import React, { Component } from 'react'
import "./selector.css"
export class Selector extends Component {



    render() {
        let currentBtn = {
            color:"white",
            background:"#222"
        }

        return (
                <div className="ProjectsList">
                    <ul className="list">
                        <li onClick={() => this.props.filterSelector("all")}> All </li>
                        <li onClick={() => this.props.filterSelector("welding")}>Welding</li>
                        <li onClick={() => this.props.filterSelector("machining")}>Machining</li>
                        <li onClick={() => this.props.filterSelector("enginering")}>Enginering</li>
                     </ul>
                </div>
        )
    }
}

export default Selector
